/*----------------------------------------------------multi-image preview------------------------------------------------*/



	var selDiv = "";
		
	document.addEventListener("DOMContentLoaded", init, false);
	
	function init() {
		document.querySelector('#files').addEventListener('change', handleFileSelect, true);
		selDiv = document.querySelector("#selectedFiles");
	}
		
	function handleFileSelect(e) {
		
		if(!e.target.files || !window.FileReader) return;
		
		selDiv.innerHTML = "";
		
		var files = e.target.files;
		var filesArr = Array.prototype.slice.call(files);
		filesArr.forEach(function(f) {
			if(!f.type.match("image.*")) {
				return;
			}
	
			var reader = new FileReader();
			reader.onload = function (e) {
				var html = "<div class='equal-image'><div class='borded-image'><img src=\"" + e.target.result + "\"></div></div>"; //  + f.name + "<br clear=\"left\"/>" ;
				selDiv.innerHTML += html;				
			}
			reader.readAsDataURL(f); 
			
		});
		
		
	}
	

	/*-------------------------------------------multi filds add remove--------------------------------------*/
	
	
	$(document).ready(function() {
    var max_fields      = 10; //maximum input boxes allowed
    var wrapper         = $(".multi-field-form"); //Fields wrapper
    var add_button      = $(".add_field_button"); //Add button ID
    
    var x = 1; //initlal text box count
    $(add_button).click(function(e){ //on add input button click
        e.preventDefault();
        if(x < max_fields){ //max input box allowed
            x++; //text box increment
            $(wrapper).append('<div class="extra-fields"><input class="form-control" placeholder="Extra Desc." type="text" name="mytext[]"/><a href="#" class="remove_field fa fa-times"></a></div>'); //add input box
        }
    });
    
    $(wrapper).on("click",".remove_field", function(e){ //user click on remove text
        e.preventDefault(); $(this).parent('div').remove(); x--;
    })
});
/*-------------------------------------------multi filds add more remove--------------------------------------*/


$(document).ready(function() {
    var c = 11;
    var d = $(".image-addon");
    var b = $(".add_img_button");
    var a = 1;
    $(b).click(function(f) {
        f.preventDefault();
        if (a < c) {
            a++;
            $(d).append('<div class="add-more"><div class="multi-img"><div class="fileupload fileupload-new" data-provides="fileupload"><div class="fileupload-preview thumbnail"></div><br><span class="btn btn-default btn-file svgimg"><span class="fileupload-new"><img src="img/image01.svg"></span><input type="file"></span></div></div><span class="remove_field fa fa-times"></span></div>')
        }
    });
    $(d).on("click", ".remove_field", function(f) {
        f.preventDefault();
        $(this).parent("div").remove();
        a--
    })
});


/*-------------------------------------------setting tab --------------------------------------*/


function openCity(evt, cityName) {
    var i, tabcontent, tablinks;
    tabcontent = document.getElementsByClassName("tabcontent");
    for (i = 0; i < tabcontent.length; i++) {
        tabcontent[i].style.display = "none";
    }
    tablinks = document.getElementsByClassName("tablinks");
    for (i = 0; i < tablinks.length; i++) {
		tablinks[i].parentElement.className = tablinks[i].parentElement.className.replace("active", "");
    }
    document.getElementById(cityName).style.display = "block";
    evt.currentTarget.parentElement.className += "active";
}